import React from "react";
import "./ShopNow.css";

const ShopNow = () => {
  return (
    <div className="shop-now-wrapper">
      <div className="shop-now-content">
        <h1>View Shop Now</h1>
        <button>Explore</button>
      </div>
    </div>
  );
};

export default ShopNow;
